import React from "react";
import headerStyles from './header.module.css';
import { Logo } from '@ya.praktikum/react-developer-burger-ui-components';
import {BurgerIcon} from '@ya.praktikum/react-developer-burger-ui-components';


class Header extends React.Component {
    render() {
      return (
        <header className={headerStyles.header}>
           {this.props.children}
           <nav className={headerStyles.content}>
            <ul className={headerStyles.menu}>  {this.props.children}
         <li className={headerStyles.link}>
            <a className={headerStyles.nav} hlef="">
           <img src={BurgerIcon} alt="Конструктор"/>
           Конструктор
           </a>
         </li>
         <li>
         <a className={headerStyles.nav} hlef="">
           <img />
           Лента заказов
           </a>
         </li>
         </ul>
        <img className={headerStyles.logo} src=<Logo /> alt="логотип." />
        <li className={headerStyles.link}>
            <a className={headerStyles.nav} hlef="">
           <img src={BurgerIcon} alt="личный кабинет"/>
           Личный кабинет
           </a>
         </li>
        </nav>
        </header>
      );
    }
}


  
export default Header;
